import React from 'react';

function Header({ setPage }) {
    console.log(setPage)

    const handlePage = (e) => {
        console.log('handlePage function called')
        const { name } = e.target
        console.log('selected page:', name)
        setPage(name)
    }

    return (
        <div>
            <p onClick={handlePage}>About Me</p>
            <p onClick={handlePage}>Portfolio</p>
            <p onClick={handlePage}>Resume</p>
            <p onClick={handlePage}>Contact</p>
        </div>
    )

}

export default Header;
